function ExpenseDate(props) {
  const day = props.date.toLocaleString("pl-PL", { day: "2-digit" });
  const month = props.date.toLocaleString("pl-PL", { month: "long" });
  const year = props.date.getFullYear();
}

export default ExpenseDate;
